import React, {
  Component
} from 'react';
import './TutorServiceRegister.css';
import 'bootstrap/dist/css/bootstrap.css';

export default class TutorServiceRegister extends Component {

  render() {
    return (
      <div>
      <table className="table table-striped table-borderless table-hover table-card">
        <thead>
          <tr className="header">
            <th>Category</th>
            <th>Subject</th>
            <th>Topic</th>
            <th>Service Type</th>
            <th>Class Size</th>
            <th>From Time</th>
            <th>To Time</th>
          </tr>
        </thead>
        <tbody>
        {this.props.tutorRegisterDetails.map((value,index) => {
          return (<tr key = {index}>
            <td><select>
            {this.props.tutorRegisterDetails.map((value,index) =>{
              <option value = {value.categoryId}>
              {value.categoryType}
              </option>
            })}
            </select></td>
            <td><select>
              <option value = {value.subjectId}>
              {value.subjectName}
              </option>
            </select></td>
            <td><select>
              <option value = {value.topicId}>
              {value.topicName}
              </option>
            </select></td>
            <td>{value.serviceType}</td>
              <td><select>
                <option>Online</option>
                <option>Offline</option>
                <option>Group Discussion</option>
              </select></td>
              <td><input type = "text"/></td>
            <td>
            <button className="btn btn-info">Register</button>
            </td>
            <td></td>
          </tr>
        )})}
        </tbody>
        </table>
      </div>
    );
  }

}
